import logo from './plant.png';
import './App.css';
import CustomButton from './Components/CustomButton/CustomButton';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
          <h2 style={{ fontFamily: 'Spinnaker', fontSize: 'calc(10px + 2vmin)' }}>
            Having a sustainable <br /> campus has never <br /> been so easy!
          </h2>
        <p style={{ fontFamily: 'Spinnaker' }}>

          For students, by students
        </p>
        <div className='container'>
          <div className='row'>
            <div className='col sm-6'>
              <CustomButton title='I have an idea' titleColor='black' buttonColor='white' />
            </div>
            <div className='col sm-6'>
              <CustomButton title='I want to support an idea' titleColor='white' buttonColor='transparent' />
            </div>
          </div>
        </div>
      </header>
    </div>
  );
}

export default App;
